import * as React from 'react';
import {NavLink} from 'react-router-dom';
import styled from '../../utils/styled';
import Container from "./Container";
import SettingsIcon from "../icons/SettingsIcon";
import {reverseSpin, spin} from "../animations/transitions";
import HeaderMenu from "./HeaderMenu";
import MenuTitleBar from "../icons/MenuTitleBar";
import DimpleIcon from "../icons/dimple";
import GlassBallIcon from "../icons/GlassBall";

interface HeaderProps {
    title: string;
    squadrons?: string[];
}

const NavMenu: React.FC<HeaderProps> = ({title}) => (
    <Wrapper>
        <HeaderTitle>
            <Title>{title}</Title>
        </HeaderTitle>
        <Menu>
        <MenuTitleBar/>
            <MenuActionBall>
                <GlassBallIcon/>
            </MenuActionBall>
        </Menu>
        <DimpleIcon/>
        <NavBorder>
        </NavBorder>

        <SettingsIcon/>
    </Wrapper>
);

export default NavMenu;

const MenuActionBall = styled('div')`
cursor: pointer;
position: absolute;
right: 6px;
top: 51px;
`;

const Menu = styled('div')`


`;

const Wrapper = styled('div')`
    position: absolute;
    display: block;
    width: 198px;
    height: 100vh;
    background-color: ${props => props.theme.colors.background};
    color: ${props => props.theme.colors.brand};
    font-family: ${props => props.theme.fonts.headings};
    z-index: 100;
`;

const HeaderTitle = styled('div')`
    margin-left: 0;
`;

const Title = styled('h2')`
    margin: 10px;
    font-weight: 500;
`;

const NavBorder = styled('div')`
position: absolute;
width: 1px;
height: 100%;
left: 198px;
top: 0px;
background: #949494;
/* Borders */

box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.25);

`;

const TopBorder = styled('div')`
position: absolute;
width: 100vw;
height: 1px;
left: 198px;
top: 55.5px;
background: #949494;

/* Borders */

box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.25);
`;
